import { useLanguage } from '../LanguageSource';
import '../index.css';
import '../styles/navbar.css';

const Navbar = () => {
	const { currentLanguage, translations } = useLanguage();
	return (
		<>
			<div className="max-w-7xl mx-auto px-2 sm:px-6 lg:px-8">
        <div className="relative flex items-center justify-between h-16">
          <div className="absolute inset-y-0 left-0 flex items-center sm:hidden">
				<nav className="nav-container py-4 align-middle text-nowrap justify-between">
					<h1 className="block relative responsive-padding">Jean Marques Vieira</h1>
					<ul className="nav-items flex align-middle items-end space-x-10 pr-10">
						<li className='align-middle'>{translations[currentLanguage].home}</li>
						<li>GitHub</li>
						<li>LinkedIn</li>
						<li>{translations[currentLanguage].getInTouch}</li>
					</ul>
				</nav>
			</div>
			</div>
			</div>
		</>
	)
}

export default Navbar;
